const Header = ()=>{
    return(
        <a class="goclick smooth " href="#">
        <button type="button" className="btn bubbly-button wow fadeIn ripple-surface-dark" id="btn-back-top" data-ripple-color="dark"><i class="fas fa-chevron-up"></i></button>
    </a>
    )
}

export default Header;
